import styled from "styled-components"
import { Hashtag } from 'styled-icons/heroicons-outline'
import { PersonAdd, Settings } from 'styled-icons/material'


export const Container = styled.div`
    display: flex;
    align-items: center;
    justify-content: space-between;
    margin-bottom: 5px;

    cursor: pointer;

    padding: 4px 7px;
    border-radius: 5px;

    background-color: transparent;

    transition: background-color .2s;

    > div {
        display: flex;
        align-items: center;
    }

    > div span {
        margin-left: 5px;
        font-size: 15px;
        color: var(--senary);
    }

    > div:nth-child(2) {
        display: none;
    }

    &.active, 
    &:hover {
        background-color: var(--quinary);

        > div span {
            color: var(--white)
        }

        > div:nth-child(2) {
        display: flex;
    }
    }

`

export const HashTagIcon = styled(Hashtag)`
    width: 23.5px;
    height: 23.5px;

    color: var(--symbol);
`

export const InviteIcon = styled(PersonAdd)`
    width: 16px;
    height: 16px;

    color: var(--symbol);
    cursor: pointer;

    transition: color .2s;

    &:hover {
        color: var(--white);
    }
`

export const SettingsIcon = styled(Settings)`
    margin-left: 5px; 
    width: 16px;
    height: 16px;

    color: var(--symbol);
    cursor: pointer;

    transition: color .2s;

    &:hover {
        color: var(--white);
    }
`
